import { AllSoulsDay } from "../feriados";
import Gregoriano from "../../../calendariosLunares/gregoriano";

export function ObterListaDeFeriados(ano) {
  const gregoriano = new Gregoriano();
  const DomingoDePascoa = gregoriano.ObterDomingoDePascoa(ano);

  const ListaDeFeriados = [AllSoulsDay];

  return ListaDeFeriados;
}
